import '../css/style.scss';

const Service = () => {
  return (
    <div className="service__component">
      <h1 className="service__title title-text--bold">
        How It Works?
      </h1>
      <p className="service__sub-title title-text">
        ELYFI Protocol allows the creation of fungible assets, “synthetics”, that track the price of real world assets.<br />ELYFI synthetics are intended to be used as key building blocks in smart contracts,<br />and to bring the world’s assets to the blockchain.
      </p>
    </div>
  );
}

export default Service;
